import React from "react";
import { Menu } from "semantic-ui-react";
import { Link } from "../routes";

export default () => {
  return (
    <Menu style={{marginTop: '10px'}} >
        <Link route="/">
        <a className="item">Reats</a>
      </Link>
    </Menu>
  );
};
